eval("module.exports = JSON.parse('{\"en\":{\"main_title\":\"Palais Garnier\",\"title\":\"Palais Garnier\",\"years\":\"1861-1875\",\"text1\":\"Charles Garnier, a young French architect, designed the Palais Garnier after winning an architecture competition. Prior to the design of the Palais Garnier, nobody knew his name. Many considered Garnier\\'s style of choice for the Palais Garnier to fall under Neo-Baroque. Neo-Baroque architecture used characteristics of the Baroque period and included vaulted ceilings, buttresses, ornate wall carvings, archways, the use of stone, and illusion.\",\"text2\":\"In addition to being influenced by Neo-Baroque architecture, the Palais Garnier was heavily influenced by the Second Empire Beaux-Arts. Second Empire Beaux-Arts was marked by heavy ornamentation, sculptures, and symmetry that makes the building look the same from all angles. The building is made of stone and iron. The exterior façade of the building is loaded with decorative ornamentation in the forms of sculptures, carvings, and columns.\",\"text3\":\"The inside of the Palais Garnier is exquisite with a grand staircase, foyer, and auditorium. Both the Grand Foyer and Grand Staircase are made from marble with heavy ornamentation and sculpture. Many of the alcoves in the Grand Foyer feature sculptures of nymphs and Greek gods. Many famous artists painted the ceiling of the Grand Foyer, including Paul Baudry, who painted two different panels on the ceiling.\"},\"ua\":{\"main_title\":\"Опера Гарньє\",\"title\":\"Опера Гарньє\",\"years\":\"1861-1875\",\"text1\":\"Шарль Гарньє, молодий французький архітектор, спроектував палац Гарньє після перемоги в архітектурному конкурсі. До проектування палацу Гарньє ніхто не знав його імені. Багато хто вважав, що стиль Гарньє обраний для палацу Гарньє. Нео-бароко. Архітектура необарокко використовувала особливості періоду бароко і включала склепінчасті стелі, контрфорси, багато прикрашені стінні різьблення, арки, використання каменю та ілюзії.\",\"text2\":\"Окрім того, що палац Гарньє перебував під впливом необароккової архітектури, палац Гарньє зазнав сильного впливу Другої Імперії Боз-Мистецтва. Друга Імперія Боз-Арт відзначалася важкими орнаментами, скульптурами та симетрією, що надає будівлю вигляду однаково з усіх боків. Будівля з каменю та заліза. Зовнішній фасад будівлі насичений декоративним орнаментом у вигляді скульптур, різьблення, колон.\",\"text3\":\"Внутрішня частина Палацу Гарньє вишукана з парадними сходами, фойє та аудиторією. І Велике фойє, і Великі сходи зроблені з мармуру з важкими орнаментами та скульптурами. У багатьох нішах Великого фойє є скульптури німф і грецьких богів. Багато відомих художників розписували стелю Великого фойє, в тому числі Поль Бодрі, який намалював на стелі два різних панно.\"},\"es\":{\"main_title\":\"Palacio Garnier\",\"title\":\"Palacio Garnier\",\"years\":\"1861-1875\",\"text1\":\"Charles Garnier, un joven arquitecto francés, diseñó el Palais Garnier después de ganar un concurso de arquitectura. Antes del diseño del Palais Garnier, nadie sabía su nombre. Muchos consideraron que el estilo elegido por Garnier para el Palais Garnier estaba incluido en Neobarroco. La arquitectura neobarroca usó características del período barroco e incluyó techos abovedados, contrafuertes, tallas ornamentadas en las paredes, arcos, el uso de piedra e ilusión.\",\"text2\":\"Además de estar influenciado por la arquitectura neobarroca, el Palais Garnier estuvo fuertemente influenciado por las Bellas Artes del Segundo Imperio. Las Bellas Artes del Segundo Imperio se caracterizaron por una gran ornamentación, esculturas y simetría que hacen que el edificio parezca el mismo desde todos los ángulos. El edificio está hecho de piedra y hierro. La fachada exterior del edificio está cargada de ornamentación decorativa en forma de esculturas, tallas y columnas.\",\"text3\":\"El interior del Palais Garnier es exquisito, con una gran escalera, un vestíbulo y un auditorio. Tanto el Gran Foyer como la Gran Escalera están hechos de mármol con mucha ornamentación y escultura. Muchos de los nichos del Gran Foyer cuentan con esculturas de ninfas y dioses griegos. Muchos artistas famosos pintaron el techo del Gran Foyer, incluido Paul Baudry, quien pintó dos paneles diferentes en el techo.\"}}');\n\n//# sourceURL=webpack:///./content/architecture/exemple/palais-garnier.json?");

